import Book from "./Book"

function BookList(props) {
//   console.log(props.bookList);
  return (
    <>
        {props.bookList.map( (thisbook,key) => { 
           <Book thisbook = {thisbook} key = {key}> </Book> } ) }

    </>
  );
}

export default BookList;
